const FetchClient = {
    async get(url){
        return await fetch(url,{
            method: 'GET',
            mode: 'no-cors'
        });
    },

    async post(url,body){
        return await fetch(url,{
            method: 'POST',
            body: JSON.stringify(body),
            headers:{
                'Content-Type': 'application/json'
            }
        });
    }
}

export default FetchClient
